import { useEffect } from "react"

 

const Home = () => {

  useEffect(()=>{
    (
      async()=>{
        await fetch('http://localhost:8000/api/user',{
        method:'POST',
        headers:{'Content-Type':'application/json'},
        credentials:'include' 
      })
      }
    )();
  })

  return (
    <div>Home</div>
  )
}

export default Home
